Human trafficking is a crime that forcefully exploits women, men, and children. According to the United Nations, human trafficking affects every country in the world, but it‚Äôs not talked about enough. So we‚Äôre talking about it.

Statistics show that 46 children in America are taken and sold into slavery per day. Who are these children? Are they criminals and runaways, vagrants and orphans? The truth is that traffickers do not discriminate when it comes to who they choose to target. Trafficking occurs in poor neighborhoods and affluent suburbs, urban centers, and rural areas. No child, family or community is without the need for awareness and protection when it comes to avoiding the terrible effects of child trafficking.

6 Ways Parents Can Protect Their Children from Sex Trafficking
Set a high standard of ‚Äúlove‚Äù within your home. ...
Talk to your children about sexual abuse. ...
Talk to your children about sex trafficking. ...
Talk to your children about the dangers of social media. Pay attention to your children. 
Invite your kids to pray for those enslaved.

