See those red X‚Äôs on my hands? Today is World Day Against Trafficking. Did you know that #humantrafficking is now a $150 Billion a year industry?

#slavery still exists today and it‚Äôs HORRIFIC. Here are some stats you may not know:

1. Trafficking involves transporting someone into a situation of exploitation. This can include forced labor, marriage, prostitution, and organ removal. This kind of exploitation is known by a few different names -- ‚Äúhuman trafficking,‚Äù ‚Äútrafficking of persons,‚Äù and ‚Äúmodern slavery‚Äù are the ones accepted by the US Department of State. 
2. It‚Äôs estimated that internationally there are between 20 million and 40 million people in modern slavery today. Assessing the full scope of human trafficking is difficult because cases so often go undetected, something the United Nations refers to as ‚Äúthe hidden figure of crime.‚Äù
3. Estimates suggest that, internationally, only about .04% survivors of human trafficking cases are identified, meaning that the vast majority of cases of human trafficking go undetected. 
4. Human trafficking earns global profits of roughly $150 billion a year for traffickers, $99 billion of which comes from commercial sexual exploitation.
5. Globally, an estimated 71% of enslaved people are women and girls, while men and boys account for 29%.
6. In 2018, over half (51.6%) of the criminal human trafficking cases active in the US were sex trafficking cases involving only children.
7. Advocates report a growing trend of traffickers using online social media platforms to recruit and advertise targets of human trafficking.

